// React
import {
  createBrowserRouter, 
  createRoutesFromElements,
  Route, 
  RouterProvider
} from 'react-router-dom'
// CSS
import './App.css';
// Layout
import RootLayout from './layout/RootLayout';



const router = createBrowserRouter(
  createRoutesFromElements(
    <router path="/" element={<RootLayout />}>
       {/* <Route index element={<Home />} /> */}
  </router>
  )
)

function App() {
  return (
    <RouterProvider router={router} />
  );
}

export default App;
